import React, { Component } from "react";

class About extends Component {
	render() {
		return (
				<div>
                    <h1>About</h1>
                    <p>This is a Fleet Management System for monitoring and controlling IIUM Medibots</p>
				</div>
		);
	}
}

export default About;
